def subdivide_list(lst, chunk_size):
    """
    Subdivides a list into sections of arbitrary length (chunk_size).

    Args:
        lst (list): The input list.
        chunk_size (int): The desired length of each section.

    Returns:
        list: A list of sublists, each containing chunk_size elements.
    """
    return [lst[i:i + chunk_size] for i in range(0, len(lst), chunk_size)]

