# Define the frequency and duration of each tone in seconds
frequencies, durations = codontofreq(geneaslist)  #

# Making the most common sections
medianfrequencies = []
count = Counter(frequencies)
medianfrequencies.append(count.most_common(1)[0][0])

i=0
while len(medianfrequencies)<0.8*len(frequencies):
    sublists = subdivide_list(frequencies,2^i)
    for sublist in sublists:
        count = Counter(sublist)
        medianfrequencies.append(count.most_common(1)[0][0])
    i=i+1

# Define the sampling rate, bit depth, and channels
sampling_rate = 44100
bit_depth = 16
channels = 1

# Calculate the total length of the audio file in samples
total_samples = int(sampling_rate * sum(durations))

# Generate the audio data as a numpy array
audio_data = np.zeros(total_samples)
current_sample = 0
for freq, dur in zip(medianfrequencies, durations):
    samples = int(sampling_rate * dur)
    t = np.linspace(0, dur, samples, False)
    waveform = np.sin(2 * np.pi * freq * t)
    audio_data[current_sample:current_sample+samples] = waveform
    current_sample += samples

# Convert the audio data to the appropriate bit depth
if bit_depth == 8:
    audio_data = np.int8(audio_data * 127)
elif bit_depth == 16:
    audio_data = np.int16(audio_data * 32767)

# Create the .wav file
with wave.open("Tonal_file.wav", "wb") as wave_file:
    wave_file.setnchannels(channels)
    wave_file.setsampwidth(bit_depth // 8)
    wave_file.setframerate(sampling_rate)
    wave_file.writeframes(audio_data.tobytes())

